import React, { useState } from 'react';
import '../styles/signin.css';
import Logo from '../assets/logo.png';
import {BrowserRouter as Router ,Route , Routes ,Link} from 'react-router-dom'; 
import Signin from '../pages/signin';
import Signup from './signup';
import Dashboard from './dashboard' ; 
function signin() {
  const [email , setemail] = useState()
  return (
    <form className="signin-form">
    <div className="image-container">
      <img src={Logo} className="rounded-circle bg-outline-light logo" alt="Logo Chatbotyy" />
    </div>

    <div className="input-container">
      <input type="text" id="form3Example1m" className="form-control form-control-lg" placeholder="Email Address" />
      <br></br>
      <br></br>
      <input type="password" id="form3Example1n" className="form-control form-control-lg" placeholder="Password" />
      <br></br>
      
      <a href="#!" className="link text-light">Forgot password?</a>
    </div>

    <div className="button-container">
      <Link to="/Dashboard" className="btn btn-outline-light btn-block mb-4">
        Sign in
      </Link>
    </div>

    <div className="text-center text-white">
      <p>
        Not a member? <Link to="/Signup" className="text-light">Register Now</Link>
      </p>
      <Routes>
        <Route path="/Signup" element={<Signup />} />
      </Routes>
    </div>
  </form>
        
  )
}

export default signin
